import React from 'react';
import Part from './Part';

const Content = (props) => {
    return (
        <div>
            <Part partNumber={props.parts[0].name} exerciseNumber={props.parts[0].exercises}></Part>
            <Part partNumber={props.parts[1].name} exerciseNumber={props.parts[1].exercises}></Part>
            <Part partNumber={props.parts[2].name} exerciseNumber={props.parts[2].exercises}></Part>
        </div>
    )
}

export default Content;
